int main() {
	// Generates random every time
	unsigned int seed;
	srand(seed);
	rand();

    while (true) {
		// OUTPUT MAIN SCREEN
        background_Intro(); 

		printf("Welcome to the Boggle Game!\n");
    	printf("Press key0 for Easy level, key1 for Medium level, key2 for Hard level.\n");
		
		// For selecting a level using pushbutton
		blankHex();
        int key = waitForKeyPressAndRelease(); // Wait for a key press and release
		// Choose a level
		// OUTPUT LEVEL SCREEN with random letters in grid
        if (key == 0) { // Easy level
			background_L1();
            printf("Starting Easy level.\n");
            generateRandomLetters(4); // Generate 4 random letters
			
			// This is used to see what words you can make with the letters
			// For debugging
			findAndPrintWords();
			
			displayGeneratedLetters();
			
			// Play game
            playGame();
			
        } else if (key == 1) { // Medium level
            background_L2();
            printf("Starting Medium level.\n");
            generateRandomLetters(9); // Generate 9 random letters
			
			// This is used to see what words you can make with the letters
			// For debugging
			findAndPrintWords();
			
			displayGeneratedLetters();
			
            playGame();
        } else if (key == 2) { // Hard level
            background_L3();
            printf("Starting Hard level.\n");
            generateRandomLetters(16); // Generate 16 random letters
			
			// This is used to see what words you can make with the letters
			// For debugging
			findAndPrintWords();
			
			displayGeneratedLetters();
			
            playGame();
        }
    }
    return 0;
}

