  // Draw the diagonal line with positive slope
  draw_double_line(x0, y0, x0 + height / 2.5, y0 + height / 2, color);

  // Draw the diagonal line with negative slope
  draw_double_line(x0, y0, x0 + height / 2.5, y0 - height / 2, color);
