  draw_circle(x0, y0, radius, color);

  // Draw the tail segment
  draw_double_line(x0 + radius / 2, y0 + radius / 2, x0 + radius, y0 + radius,
                   color);
  draw_double_line(1 + x0 + radius / 2, y0 + radius / 2, 1 + x0 + radius,
                   y0 + radius, color);
